import Cabeza from '../componentes/Cabeza';
import Pie from '../componentes/Pie';



class registro extends Component{
    state={};

    render(){
        return(  
            <div>
                <Cabeza/>
                <p>Esta es la segunda pagina </p>
                <Pie/> 

            </div>             

        )
    }
}
export default registro;
